import './App.css';
import {BrowserRouter, Route, Routes, Link} from 'react-router-dom';
import Home from './Components/Home';
import SpeOne from './Components/Pages/SpeOne';
import NavBar from './Components/NavBar/NavBar';
import SpeTwo from './Components/Pages/SpeTwo';
import Content from './Components/Content';

function App() {


  return (
    <div className="App flex flex-row font-['Montserrat']">
        <BrowserRouter>
				<nav className='flex flex-col justify-between h-screen bg-white border-r w-80 flex-[20]'>
					{/* <Link to="/">Home</Link>
					<Link to="/spe1">SPE1</Link>
					<Link to="/spe2">About</Link> */}
          <NavBar />
				</nav>

				<Routes>
					<Route path="/" element={<Home />}/>
					<Route path="/spe1" element={<SpeOne />}/>
					<Route path="/spe2" element={<SpeTwo />}/>
				</Routes>

        <Content />

			</BrowserRouter>
    </div>
  );
}

export default App;
